const userData = {
    name: "Albert",
    weather: {
      temperature: 19,
      condition: "Rainy",
    },
    humidity: 65,
    totalConsumption: 160,
    lighting: {
      intensity: 80,
    },
    thermostat: {
      temperature: 25,
    },
    devices: [
      { name: "Smart Light", status: "On" },
      { name: "Air Conditioner", status: "Off" },
      { name: "Door Lock", status: "Locked" },
      { name: "Cleaning Vacuum", status: "Off" },
    ],
  };

  export default userData;
